import PaginatedPanel from "./PaginatedPanel";

const renderGameEntry = (game) => (
    <a href={`/item/${game.id}/`}>
        {game.name ? game.name : `Game ${game.id}`}
    </a>
)

const GamesPanel = ({games, title = "Games"}) =>{
    return (
        <PaginatedPanel items={games} itemsPerPage={10} title={title} renderEntry={renderGameEntry}/>
    );
};

export default GamesPanel;
